import{_ as e,c as o,o as d,a}from"./app.1e3d666e.js";const c="/phpstorm/assets/close-search-man-page-index-in-terminal.443bc3bc.png",u=JSON.parse('{"title":"\u5E38\u7528\u5FEB\u6377\u952E","description":"","frontmatter":{},"headers":[{"level":2,"title":"\u67E5\u627E\u64CD\u4F5C Command + Shift + A","slug":"\u67E5\u627E\u64CD\u4F5C-command-shift-a","link":"#\u67E5\u627E\u64CD\u4F5C-command-shift-a","children":[]},{"level":2,"title":"\u6587\u4EF6\u67E5\u627E Command + Shift + O","slug":"\u6587\u4EF6\u67E5\u627E-command-shift-o","link":"#\u6587\u4EF6\u67E5\u627E-command-shift-o","children":[]},{"level":2,"title":"\u67E5\u770B\u51FD\u6570\u6216\u65B9\u6CD5\u5B9A\u4E49 Command + B","slug":"\u67E5\u770B\u51FD\u6570\u6216\u65B9\u6CD5\u5B9A\u4E49-command-b","link":"#\u67E5\u770B\u51FD\u6570\u6216\u65B9\u6CD5\u5B9A\u4E49-command-b","children":[]},{"level":2,"title":"\u5207\u6362\u6253\u5F00\u7684\u6587\u4EF6\u8BB0\u5F55 Command + E","slug":"\u5207\u6362\u6253\u5F00\u7684\u6587\u4EF6\u8BB0\u5F55-command-e","link":"#\u5207\u6362\u6253\u5F00\u7684\u6587\u4EF6\u8BB0\u5F55-command-e","children":[]},{"level":2,"title":"\u67E5\u770B\u6587\u4EF6\u5305\u542B\u5C5E\u6027\u6216\u65B9\u6CD5 Commnad + F12","slug":"\u67E5\u770B\u6587\u4EF6\u5305\u542B\u5C5E\u6027\u6216\u65B9\u6CD5-commnad-f12","link":"#\u67E5\u770B\u6587\u4EF6\u5305\u542B\u5C5E\u6027\u6216\u65B9\u6CD5-commnad-f12","children":[]}],"relativePath":"guide/some-important-keybindings.md","lastUpdated":1662299211000}'),n={name:"guide/some-important-keybindings.md"},t=a('<h1 id="\u5E38\u7528\u5FEB\u6377\u952E" tabindex="-1">\u5E38\u7528\u5FEB\u6377\u952E <a class="header-anchor" href="#\u5E38\u7528\u5FEB\u6377\u952E" aria-hidden="true">#</a></h1><p>\u7ECF\u8FC7\u6781\u7B80\u914D\u7F6E\u540E\u7684 PhpStorm \u7F16\u8F91\u5668\u5728\u4E3B\u7F16\u8F91\u754C\u9762\u51E0\u4E4E\u770B\u4E0D\u5230\u64CD\u4F5C\u6309\u94AE\uFF0C\u6B64\u65F6\u4F7F\u7528\u5FEB\u6377\u952E\u64CD\u4F5C\u80FD\u663E\u8457\u63D0\u5347\u5F00\u53D1\u6548\u7387\u3002</p><p>\u4EE5\u4E0B\u4EE5 <strong>macOS</strong> \u5FEB\u6377\u952E\u914D\u7F6E\u505A\u6F14\u793A\uFF0C\u6BD4\u5982\uFF1A</p><ul><li>\u67E5\u627E\u64CD\u4F5C\uFF1A<code>Command + Shift + A</code></li><li>\u6587\u4EF6\u67E5\u627E\uFF1A<code>Command + Shift + O</code></li><li>\u67E5\u770B\u51FD\u6570\u6216\u65B9\u6CD5\u5B9A\u4E49\uFF1A<code>Command + B</code></li><li>\u5207\u6362\u6587\u4EF6\u5B9A\u4E49\uFF1A<code>Command + E</code></li><li>\u67E5\u770B\u6587\u4EF6\u5305\u542B\u5C5E\u6027\u6216\u65B9\u6CD5\uFF1A<code>Command + F12</code></li></ul><h2 id="\u67E5\u627E\u64CD\u4F5C-command-shift-a" tabindex="-1">\u67E5\u627E\u64CD\u4F5C <code>Command + Shift + A</code> <a class="header-anchor" href="#\u67E5\u627E\u64CD\u4F5C-command-shift-a" aria-hidden="true">#</a></h2><p>\u8BE5\u547D\u4EE4\u5728\u7F16\u8F91\u5668\u7684 \u4E3B\u83DC\u5355 -&gt; <code>Help</code> -&gt; <code>Find Action...</code> \u540E\uFF0C\u53EF\u4EE5\u5728\u83DC\u5355\u7684\u540E\u9762\u770B\u5230\u5FEB\u6377\u952E\u4E3A\uFF1A<code>Command + Shift + A</code>\u3002</p><blockquote><p>\u5982\u679C\u6267\u884C\u4E0A\u9762\u7684\u547D\u4EE4\u6253\u5F00\u5E26\u6709 <code>apropos</code> \u641C\u7D22\u800C\u4E0D\u662F <code>\u67E5\u627E\u64CD\u4F5C</code> \u5BF9\u8BDD\u6846\u7684\u7EC8\u7AEF\uFF0C\u8BF7<a href="https://intellij-support.jetbrains.com/hc/en-us/articles/360005137400-Cmd-Shift-A-hotkey-opens-Terminal-with-apropos-search-instead-of-the-Find-Action-dialog" target="_blank" rel="noreferrer">\u53C2\u8003\u8FD9\u91CC</a>\u3002</p><details class="details custom-block"><summary>\u70B9\u51FB\u5207\u6362\u622A\u56FE\u5C55\u793A\u4E0E\u9690\u85CF</summary><ol><li>\u6253\u5F00 <code>\u82F9\u679C\u7CFB\u7EDF\u83DC\u5355</code> | <code>\u7CFB\u7EDF\u504F\u597D\u8BBE\u7F6E</code> | <code>\u952E\u76D8</code> | <code>\u5FEB\u6377\u952E</code> | <code>\u670D\u52A1</code></li><li>\u7981\u7528\u6216 Search man Page Index in Terminal (or change the shortcut) <img src="'+c+'" alt=""></li></ol></details></blockquote><p>\u5728\u4E0A\u4E00\u8282 <strong>\u6781\u7B80\u914D\u7F6E</strong> \u4E2D\u4ECB\u7ECD\u7684\u5BF9\u5E94\u914D\u7F6E\u5982\uFF1A\u6807\u7B7E\u4F4D\u7F6E <code>Tab placement</code> \u3001\u5DE5\u5177\u7A97\u53E3\u680F <code>Tool Window Bars</code>\u3001\u884C\u53F7 <code>Line Numbers</code> \u7B49\u7B49\u5C31\u53EF\u4EE5\u901A\u8FC7\u8FD9\u4E2A\u5FEB\u6377\u952E\u8FDB\u884C\u641C\u7D22\u540E\u5207\u6362\u663E\u793A\u914D\u7F6E\u3002</p><h2 id="\u6587\u4EF6\u67E5\u627E-command-shift-o" tabindex="-1">\u6587\u4EF6\u67E5\u627E <code>Command + Shift + O</code> <a class="header-anchor" href="#\u6587\u4EF6\u67E5\u627E-command-shift-o" aria-hidden="true">#</a></h2><p>\u8BE5\u547D\u4EE4\u5728\u7F16\u8F91\u5668\u7684 \u4E3B\u83DC\u5355 -&gt; <code>Navigate</code> -&gt; <code>File...</code> \u540E\uFF0C\u53EF\u4EE5\u5728\u83DC\u5355\u7684\u540E\u9762\u770B\u5230\u5FEB\u6377\u952E\u4E3A\uFF1A<code>Command + Shift + O</code>\u3002</p><p>\u5728\u5B9E\u9645\u5F00\u53D1\u7F16\u7801\u65F6\uFF0C\u7ECF\u5E38\u4F1A\u9700\u8981\u6253\u5F00\u4E0D\u540C\u76EE\u5F55\u7684\u4E0D\u540C\u6587\u4EF6\u3002\u901A\u8FC7\u547D\u4EE4 <code>Command + Shift + O</code> \u547D\u4EE4\u540E\u8F93\u5165\u5BF9\u5E94\u6587\u4EF6\u6240\u5728\u76EE\u5F55/\u6587\u4EF6\u540D\u79F0\uFF0C\u6216\u8005\u76F4\u63A5\u8F93\u5165\u6587\u4EF6\u540D\u540E\u5728\u4E0B\u62C9\u5217\u8868\u5904\u627E\u5230\u5BF9\u5E94\u6587\u4EF6\u540E\u70B9\u51FB\u56DE\u8F66\u786E\u8BA4\u6253\u5F00\u6587\u4EF6\u5373\u53EF\u3002</p><h2 id="\u67E5\u770B\u51FD\u6570\u6216\u65B9\u6CD5\u5B9A\u4E49-command-b" tabindex="-1">\u67E5\u770B\u51FD\u6570\u6216\u65B9\u6CD5\u5B9A\u4E49 <code>Command + B</code> <a class="header-anchor" href="#\u67E5\u770B\u51FD\u6570\u6216\u65B9\u6CD5\u5B9A\u4E49-command-b" aria-hidden="true">#</a></h2><p>\u8BE5\u547D\u4EE4\u5728\u7F16\u8F91\u5668\u7684 \u4E3B\u83DC\u5355 -&gt; <code>Navigate</code> -&gt; <code>Declaration or Usages</code> \u540E\uFF0C\u53EF\u4EE5\u5728\u83DC\u5355\u7684\u540E\u9762\u770B\u5230\u5FEB\u6377\u952E\u4E3A\uFF1A<code>Command + B</code>\u3002</p><ol><li>\u5728 PHP \u6587\u4EF6\u4E2D\u9047\u5230\u51FD\u6570\u6216\u65B9\u6CD5\u5B9A\u4E49\uFF0C\u60F3\u8FDB\u5165\u5230\u51FD\u6570\u6216\u65B9\u6CD5\u7684\u5B9A\u4E49\u5904\u67E5\u770B\u51FD\u6570\u6216\u65B9\u6CD5\u8FD0\u884C\u7684\u903B\u8F91\uFF1B</li><li>\u6216\u60F3\u770B\u4E0B\u5B9A\u4E49\u7684\u65B9\u6CD5\u5728\u90A3\u4E9B\u5730\u65B9\u6709\u8C03\u7528\u3002</li></ol><p>\u53EF\u4EE5\u4F7F\u7528 <code>Command + B</code> \u8FDB\u5165\u5230\u5BF9\u5E94\u7684\u51FD\u6570\u6216\u8005\u65B9\u6CD5\u5B9A\u4E49\u6216\u8005\u8DF3\u8F6C\u5230\u5BF9\u5E94\u8C03\u7528\u5904\u3002</p><h2 id="\u5207\u6362\u6253\u5F00\u7684\u6587\u4EF6\u8BB0\u5F55-command-e" tabindex="-1">\u5207\u6362\u6253\u5F00\u7684\u6587\u4EF6\u8BB0\u5F55 <code>Command + E</code> <a class="header-anchor" href="#\u5207\u6362\u6253\u5F00\u7684\u6587\u4EF6\u8BB0\u5F55-command-e" aria-hidden="true">#</a></h2><p>\u8BE5\u547D\u4EE4\u5728\u7F16\u8F91\u5668\u7684 \u4E3B\u83DC\u5355 -&gt; <code>View</code> -&gt; <code>Recent Files</code> \u540E\uFF0C\u53EF\u4EE5\u5728\u83DC\u5355\u7684\u540E\u9762\u770B\u5230\u5FEB\u6377\u952E\u4E3A\uFF1A<code>Command + E</code>\u3002</p><p>PhpStorm\u4E2D\u9ED8\u8BA4\u4F1A\u8BB0\u5F55\u6253\u5F00\u7684\u6587\u4EF6\uFF0C\u4EE5\u4FBF\u6211\u4EEC\u5FEB\u901F\u68C0\u7D22\uFF0C\u53EF\u4EE5\u4F7F\u7528 <code>Command + E</code> \u5FEB\u6377\u952E\u5FEB\u901F\u8DF3\u8F6C\u5230\u8FD1\u671F\u6253\u5F00\u7684\u6587\u4EF6\uFF0C\u9009\u4E2D\u6587\u4EF6\u540E\u6309\u56DE\u8F66\u91CD\u65B0\u6253\u5F00\u4E4B\u524D\u6253\u5F00\u8FC7\u7684\u6587\u4EF6\u3002</p><p>\u8FD9\u5728\u6211\u4EEC\u9891\u7E41\u5207\u6362\u6587\u4EF6\u64CD\u4F5C\u65F6\u975E\u5E38\u9AD8\u6548\u3002</p><h2 id="\u67E5\u770B\u6587\u4EF6\u5305\u542B\u5C5E\u6027\u6216\u65B9\u6CD5-commnad-f12" tabindex="-1">\u67E5\u770B\u6587\u4EF6\u5305\u542B\u5C5E\u6027\u6216\u65B9\u6CD5 <code>Commnad + F12</code> <a class="header-anchor" href="#\u67E5\u770B\u6587\u4EF6\u5305\u542B\u5C5E\u6027\u6216\u65B9\u6CD5-commnad-f12" aria-hidden="true">#</a></h2><p>\u8BE5\u547D\u4EE4\u5728\u7F16\u8F91\u5668\u7684 \u4E3B\u83DC\u5355 -&gt; <code>Navigate</code> -&gt; <code>File Structure</code> \u540E\uFF0C\u53EF\u4EE5\u5728\u83DC\u5355\u7684\u540E\u9762\u770B\u5230\u5FEB\u6377\u952E\u4E3A\uFF1A<code>Command + F12</code>\u3002</p><p>\u9488\u5BF9PHP\u7C7B\u548C\u51FD\u6570\u6587\u4EF6\uFF0C\u53EF\u4EE5\u4F7F\u7528 <code>Commnad + F12</code> \u53EF\u4EE5\u67E5\u770B\u8BE5\u7C7B\u6587\u4EF6\u7684\u6210\u5458\u53D8\u91CF\u548C\u65B9\u6CD5\uFF0C\u518D\u6B21\u6309 <code>Command + F12</code> \u53EF\u4EE5\u4E00\u5E76\u5217\u51FA\u7236\u7C7B\u7684\u6210\u5458\u53D8\u91CF\u548C\u65B9\u6CD5\u3002\u8FD9\u4E2A\u529F\u80FD\u5728\u67E5\u770B\u6E90\u7801\u65F6\u4F7F\u7528\u975E\u5E38\u9891\u7E41\u3002</p>',22),i=[t];function m(l,r,s,h,p,f){return d(),o("div",null,i)}const _=e(n,[["render",m]]);export{u as __pageData,_ as default};
